  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Hatchie NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Hatchie NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, and information about the management
  direction and plan implementation. Key planning issues include: fish and wildlife
  populations, habitat, visitor services, administration, and land protection.\",\n\t\"license_title\":
